import users from "../../";

const Employees = () => {
  return (
    <div className='container'>
      {users.map((u) => {
        return (
          <div>
            <img
              src={process.env.REACT_APP_CLIENT_URL + u.img}
              alt='employee'
            />
            <h3>{u.name}</h3>
            <p>Специализация: {u.major}</p>
            <p>Опыт: {u.expirience}</p>
          </div>
        );
      })}
    </div>
  );
};

export default Employees;
